import React from 'react';
import arcadeImage from '../../src/images/icon-arcade.svg';

import Slider from './Slider';

export default function Selectplan({}) {
  const image = arcadeImage;
  console.log(image);
  const monthlyOptions = [
    {
      id: 1,
      name: 'Arcade',
      price: 9,
      planType: 'monthly',
      image: { image },
    },
    {
      id: 2,
      name: 'Advanced',
      price: 12,
      planType: 'monthly',
    },
    {
      id: 3,
      name: 'Pro',
      price: 15,
      planType: 'monthly',
    },
  ];
  const yearlyOptions = [
    {
      id: 1,
      name: 'Arcade',
      price: 90,
      text: '2 months free',
      planType: 'yearly',
    },
    {
      id: 2,
      name: 'Advanced',
      price: 120,
      planType: 'yearly',
    },
    {
      id: 3,
      name: 'Pro',
      price: 150,
      planType: 'yearly',
    },
  ];

  return (
    <div className="content">
      <div className="content-text">
        <h1>Select your plan</h1>
        <p>You have the option of monthly or yearly billing</p>
      </div>

      <Slider
        monthlyPlans={monthlyOptions}
        yearlyPlans={yearlyOptions}
      ></Slider>
    </div>
  );
}
